# Mapping from sanitized enum names to original tag names
_original_names = {24599: "16BIT_DESCRIPTION", 24608: "16BIT_MODULE_NAME"}


def tag_id_to_string(tag: int) -> str:
    """Converts a tag to its string representation."""
    if tag in _original_names:
        return _original_names[tag]
    if tag in Tags._value2member_map_:
        return Tags._value2member_map_[tag].name
    return "InvalidTag"


